config.script:
selectedColumn = self.props.selection.selectedColumn

if selectedColumn == "Options":
	bedId = event.value.get("bedId")
	startDate = self.view.params.wherePlusIn[0].arg
	endDate = self.view.params.wherePlusIn[1].arg

	params = {"bedId": bedId, "startDate": startDate, "endDate": endDate}
	system.perspective.openDock(id="PreviewScheduleBed" ,params=params)

else:
	try:
		system.perspective.closeDock(id="PreviewScheduleBed")
	except:
		pass

